(2449, 97, '[problem:9] test an answer', 'select nama_hari,nama_mk,nama_kelas,jam1.waktu_mulai,jam1.waktu_selesai,nama_ruang from jadwal \r\njoin kelas on kelas.id_kelas=jadwal.id_kelas\r\njoin hari on hari.id_hari=jadwal.id_hari\r\njoin mk on mk.id_mk=jadwal.id_mk \r\njoin jp as jam1 on jam1.id_jp=jadwal.ID_JP_MULAI\r\njoin jp as jam1 on jam1.ID_JP=jadwal.ID_JP_SELESAI\r\njoin ruang on ruang.id_ruang=jadwal.id_ruang\r\nwhere nip=\'DRY\' or nip=\'FUM\';', '2020-05-07 09:28:18', '139.195.124.6'),
(2450, 100, '[problem:15] test an answer', 'SELECT mahasiswa.NAMA_MHS, SEC_TO_TIME(SUM(TIME_TO_SEC(TIMEDIFF(waktu_selesai.WAKTU_SELESAI, waktu_mulai.WAKTU_MULAI)))) AS lama_dikampus_dalam_jam FROM jadwal INNER JOIN hari ON jadwal.ID_HARI = hari.ID_HARI INNER JOIN kelas ON jadwal.ID_KELAS = kelas.ID_KELAS INNER JOIN mahasiswa ON mahasiswa.ID_KELAS = kelas.ID_KELAS INNER JOIN jp AS waktu_mulai ON jadwal.ID_JP_MULAI = waktu_mulai.ID_JP INNER JOIN jp AS waktu_selesai ON jadwal.ID_JP_SELESAI = waktu_selesai.ID_JP WHERE hari.NAMA_HARI = \'RABU\' AND mahasiswa.NAMA_MHS IN (\'HAMDAN DAALAL FAUZI\', \'HARIST DANI HISYAM RISYALMAN\') GROUP BY mahasiswa.NIM ORDER BY mahasiswa.NAMA_MHS', '2020-05-07 09:28:20', '114.124.161.172'),
