(2583, 110, '[problem:11] test an answer', 'select nama_ruang,count(nama_ruang) as dipakai_dalam_seminggu,sum(4*30000) as harga_listrik_sebulan from jadwal,ruang where ruang.ID_RUANG=jadwal.ID_RUANG group by nama_ruang', '2020-05-07 09:31:27', '203.78.118.47'),
