(2585, 91, '[problem:9] test an answer', 'select hari.nama_hari, mk.nama_mk, kelas.nama_kelas, jp.waktu_mulai, jp.waktu_selesai , ruang.nama_RUANG\r\nfrom kelas\r\ninner join jadwal on kelas.id_kelas = jadwal.id_kelas \r\n\r\ninner join mk on jadwal.id_mk = mk.id_mk \r\n\r\ninner join jp on jadwal.id_jp_mulai = jp.ID_JP\r\n\r\ninner join hari on jadwal.id_hari = hari.id_hari\r\n inner join ruang on jadwal.id_ruang = ruang.ID_RUANG\r\ninner join dosen on jadwal.nip = dosen.NIP\r\nwhere nama_mk = \'Basis Data\' & \'Bahasa Inggris\' group by hari.nama_hari limit 0,5', '2020-05-07 09:31:28', '125.166.118.143'),
