INSERT INTO `problems` (`id`, `order`, `title`, `description`, `score`, `dbname`, `tables`, `answer`, `verifier`) VALUES
(1, 1, 'Aku mau kuliah apa ya?', '<p>Mas Kuncoro telah lulus SMK dan akan melanjutkan ke perguruan tinggi. Sebelum memilih jurusan, Mas Kuncoro mulai mempelajari kurikulum-kurikulum di jurusan jurusan yang ia minati. Bantulah Mas Kuncoro untuk mempelajarai kurikulum tersebut dengan menampilkan daftar nama mata kuliah yang ada di Jurusan Teknologi Informasi.</p>', 2, '', 'mk', 'Select NAMA_MK from mk', ''),
(2, 2, 'Aku mau traktiran nih,', '<p>Dama adalah mahasiswa paling dermawan di dunia. Hari ini dia mau mentraktir Es Dempo teman-teman sekelasnya di TI-1A. Untuk melakukan reservasi tempat duduk, Dama memerlukan jumlah anak di kelasnya. Bantu Dama untuk mendapatkan jumlah mahasiswa di kelas TI-IA. (id kelas TI 1A adalah 901)</p>', 3, '', 'mahasiswa', 'select count(nim) as jumlah_mahasiswa_TI1A from mahasiswa where id_kelas=\'901\'', ''),
(3, 4, 'Bagi bagi sembako', '<p>Nabila seorang wanita yang mandiri. Dia mampu mendirikan \"klontong center\" guna persedian sembako di lingkungan rumahnya. Suatu hari Nabila kedatangan 1000 Kg tepung kanji, dan dia berencana untuk membagi-bagikan tepung tersebut ke teman-temannya di saat senja tiba. Bantu Nabila untuk menghitung jumlah mahasiswa di tiap-tiap kelas agar Nabila dapat segera membagikan tepung kanji tersebut sebelum senja pergi.&nbsp;&nbsp;</p>', 7, '', 'mahasiswa, kelas', 'select nama_kelas, count(nim) as jumlah_mahasiswa from kelas, mahasiswa where mahasiswa.id_kelas=kelas.id_kelas group by nama_kelas', ''),
(4, 3, 'Setelah pulang kampung', '<p>Arif Jong Un baru saja kembali dari kampung halamannya di PyongYang. Karena perjalanan yang lama dia mengalami jetlag sehingga lupa nama-nama teman-temannya dan juga kelasnya. Bantulah Arif untuk mendapatkan daftar nama teman-temannya dan juga kelasnya diurutkan berdasarkan abjad.</p>', 5, '', 'mahasiswa, kelas', 'select nama_mhs, nama_kelas from mahasiswa inner join kelas on mahasiswa.id_kelas=kelas.id_kelas order by nama_mhs;', ''),
(5, 5, 'Kelas mana yang kosong?', '<p>Pak Bambang adalah seorang admin akademik yang bertugas untuk mencatat kehadiran mahasiswa. Untuk kebutuhan tersebut Pak Bambang memerlukan data&nbsp;mahasiswa beserta kelasnya dan kelas mana saja yang belum ada data mahasiswanya. Bantu pak bambang untuk mendapatkan data tersebut</p>', 8, '', 'mahasiswa, kelas', 'select nama_kelas , nama_mhs from kelas left join mahasiswa on kelas.id_kelas=mahasiswa.id_kelas;', ''),
(6, 6, 'Siapa saja ya dosenku', '<p>Selama liburan, Riska terlalu sering bermain badminton hingga dia lupa jadwal perkuliahannya. Bantu riska untuk mendapatkan daftar mata kuliah yang akan dia ikuti di hari senin. NIM Riska adalah:&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 68pt;\" border=\"0\" width=\"91\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"height: 15.0pt;\">\r\n<td class=\"xl58\" style=\"height: 15.0pt; width: 68pt;\" width=\"91\" height=\"20\">1941720073</td>\r\n</tr>\r\n</tbody>\r\n</table>', 10, '', 'hari, mk, mahasiswa, kelas, jadwal', 'select nama_mhs, nama_hari, nama_mk from mk, hari, kelas, jadwal, mahasiswa where mahasiswa.id_kelas=kelas.id_kelas and kelas.id_kelas=jadwal.id_kelas and jadwal.id_hari=hari.id_hari and jadwal.id_mk=mk.id_mk and nama_hari=\'senin\' and nim=\'1941720073\';', ''),
(7, 7, 'Aku kuliah sampai jam berapa', '<p>ANDI MUH FADHIL BASO berencana ke bengkel untuk servis rutin CBR nya pada hari senin, namun dia memiliki jadwal kuliah basis data pada pagi hari. Bantu andi untuk mengetahui kapan perkuliahan tersebut&nbsp;selesai.</p>', 15, '', 'mk, hari, jp, kelas, jadwal, mahasiswa', 'select nama_mhs, nama_hari, nama_mk, j.waktu_mulai, p.waktu_selesai from mk, hari, kelas, jadwal, mahasiswa, jp j, jp p where mahasiswa.id_kelas=kelas.id_kelas and kelas.id_kelas=jadwal.id_kelas and jadwal.id_hari=hari.id_hari and jadwal.id_mk=mk.id_mk and p.id_jp=jadwal.id_jp_selesai and j.id_jp=jadwal.id_jp_mulai and nama_hari=\'senin\' and nama_mhs=\'andi muh fadhil baso\' and nama_mk=\'basis data\'', ''),
(8, 8, 'Ruang sibuk', '<p>Padatnya jadwal kuliah di JTI, membuat pak bambang pusing untuk mencari ruangan yang sibuk maupun yang tidak. bantu pak bambang mencari tahu jumlah pemakaian ruangan di JTI (berapa kalai ruangan tersebut dipakai)!</p>', 10, '', 'ruang, jadwal', 'select r.nama_ruang , count(j.id_ruang) as jumlah_pemakaian\r\nfrom ruang r\r\nleft join jadwal j\r\non r.id_ruang = j.id_ruang group by r.nama_ruang order by jumlah_pemakaian asc ;', ''),
(9, 9, 'Jadwal dosen kapan?', '<p>Rizqullah Osiris adalahn seorang mahasiswa super rajin yang senantiasa memiliki keingintahuan yang tinggi, sampai-sampai dia merasa mata kuliah di kelas tidak cukup. hari ini dia ingin menemui dosennya, yaitu&nbsp; Pak Dika dan Pak Faiz. Tetapi dia tidak tahu jadwal beliau, karena walaupun sangat muda, tetapi jam terbangnya sangat tinggi. Bantulah Osiris ini untuk mencari tahu jadwal Pak Dika dan Pak Faiz agar dia mendapatkan kepuasan untuk mendalami materi kuliah</p>', 20, '', 'jadwal, hari, mk, kelas, jp, ruang, dosen', 'select h.nama_hari, mk.nama_mk, k.nama_kelas, jp.waktu_mulai, jp.waktu_selesai, r.nama_ruang \r\nfrom jadwal j\r\njoin hari h \r\non j.id_hari = h.id_hari\r\njoin mk\r\non j.id_mk = mk.id_mk\r\njoin kelas k\r\non j.id_kelas = k.id_kelas\r\njoin jp\r\non j.id_jp_mulai = jp.id_jp\r\njoin ruang r \r\non j.id_ruang = r.id_ruang\r\nwhere j.nip = \'DRY\' or j.nip=\'FUM\'', ''),
(10, 10, 'Flashdisk siapa ini?', '<p>Gusti Wiharja menemukan sebuah flashdisk, Karena gusti wiharja seorang yang bersahaja maka ia akan mengembalikan flashdik tersebut kepada yang punya. yang dia&nbsp;tahu bahwa flash disk tersebut di temukan di kelas Ruang Teori 1 pada hari selasa dengan tulisan nama inisial dia adalah DI, siapa ya kira-kira pemilik flash disk tersebut?</p>', 20, '', 'mahasiswa,kelas,jadwal,hari,ruang', 'SELECT distinct(mahasiswa.NAMA_MHS) FROM mahasiswa inner join kelas on mahasiswa.ID_KELAS=kelas.ID_KELAS inner join jadwal on jadwal.ID_KELAS=kelas.ID_KELAS inner join hari on hari.ID_HARI=jadwal.ID_HARI inner join ruang on ruang.ID_RUANG=jadwal.ID_RUANG where ruang.NAMA_RUANG=\'Ruang Teori 1 (RT 01)\' and hari.NAMA_HARI = \'selasa\' and mahasiswa.NAMA_MHS LIKE \'DI%\'', ''),
(11, 11, 'Sebulan bayar listrik berapa ya?', '<p>Bapak kajur sudah membeli komputer apple di Ruang Teori 1 (RT 01) untuk pelajaran basis data, seharinya listrik diruangan tersebut memakai listrik seharga Rp 30.000,- . Berapa kali ruangan tersebut dipakai dalam seminggu dan berapa harga listrik total dalam pemakaian sebulan&nbsp;?</p>', 25, '', 'ruang, jadwal', 'SELECT ruang.NAMA_RUANG as nama_ruang, count(ruang.ID_RUANG) as dipakai_seminggu ,count(ruang.ID_RUANG)*30000*4 as harga_listrik_sebulan from ruang inner join jadwal on ruang.ID_RUANG=jadwal.ID_RUANG where ruang.NAMA_RUANG = \'Ruang Teori 1 (RT 01)\'', ''),
(12, 12, 'Gaji Bulanan', '<p>Pak Bambang akan membayar gaji dosen dengan ketentuan 5000 rupiah di setiap satu jam pelajarannya, bantu pak bambang untuk mendapatkannyajumlah gaji dosen dalam sebulan jika pada bulan itu tidak ada libur.</p>', 30, '', 'jp, dosen, jadwal', 'SELECT dosen.NAMA_DOSEN, SUM(jadwal.ID_JP_SELESAI - jadwal.ID_JP_MULAI+1) as jumlah_jam_pertemuan, SUM(jadwal.ID_JP_SELESAI - jadwal.ID_JP_MULAI+1)*5000*4 as jumlah_gaji_perbulan from dosen inner join jadwal on dosen.NIP = jadwal.NIP inner join jp on jp.ID_JP=jadwal.ID_JP_MULAI inner join jp as jp2 on jp2.ID_JP=jadwal.ID_JP_SELESAI GROUP BY dosen.NAMA_DOSEN', ''),
(13, 0, 'DEMO', '<p>saya mau tahu daftar mahasiswa</p>', 0, '', 'mahasiswa', 'select * from mahasiswa', ''),
(14, 13, 'Mak Comblang Mencari Cinta', '<p>Kamu membuka usaha agen mak comblang. Suatu saat ada customer datang dan mengatakan bahwa dia sedang jatuh cinta pada pandangan ke lima dengan mahasiswa yang dia tidak tahu namanya. yang dia tahu hanyalah mahasiswa tersebut berada di&nbsp;Ruang Teori 5 pada hari jumat . dan ketika di absen berdasarkan abjad, dia dipanggil diantara urutan ke 10 hingga 15. siapakah mahasiswa-mahasiswa dan kelas apa yang masuk pada kategori tersebut?</p>', 20, '', 'mahasiswa, kelas, hari, ruang, jadwal', 'SELECT mahasiswa.NAMA_MHS, kelas.nama_kelas FROM mahasiswa inner join kelas on mahasiswa.ID_KELAS=kelas.ID_KELAS inner join jadwal on jadwal.ID_KELAS=kelas.ID_KELAS inner join hari on hari.ID_HARI=jadwal.ID_HARI inner join ruang on ruang.ID_RUANG=jadwal.ID_RUANG where ruang.id_RUANG=\'505\' and hari.NAMA_HARI = \'JUMAT\' order by nama_mhs limit 9,6', ''),
(15, 14, 'Bermain bersama adik', '<p>HARIST DANI HISYAM RISYALMAN dan HAMDAN DAALAL FAUZI berjanji untuk bermain&nbsp; game CTR bersama adik pada hari rabu. Namun, dia lupa bahwa pada hari tersebut dia memiliki jadwal kuliah. Sebagai gantinya harist akan mengganti bermain game CTR di hari lain dengan jumlah jam sesuai dengan jumlah jam dia meninggalkan adiknya untuk kuliah di kampus pada hari kamis. Berapa jam kah harist dan&nbsp;hamdan masing-masing di kampus pada hari rabu?&nbsp;</p>', 30, '', 'hari, kelas, jadwal, mahasiswa, jp', 'select nama_mhs, timediff(max(p.waktu_selesai),min(j.waktu_mulai)) as lama_dikampus_dalam_jam from hari, kelas, jadwal, mahasiswa, jp j, jp p where mahasiswa.id_kelas=kelas.id_kelas and kelas.id_kelas=jadwal.id_kelas and jadwal.id_hari=hari.id_hari and p.id_jp=jadwal.id_jp_selesai and j.id_jp=jadwal.id_jp_mulai and nama_hari=\'rabu\' and (nama_mhs=\'HARIST DANI HISYAM RISYALMAN\' or nama_mhs=\'HAMDAN DAALAL FAUZI\') group by nama_mhs', ''),
(16, 15, 'Berangkat mengajar', '<p>dosen-dosen&nbsp;akan berangkat ke kampus 30 menit lebih awal dari jadwal mengajarnya pada hari selasa. Jam berapakah&nbsp;dosen-dosen mulai mengajar pada hari selasa?</p>', 15, '', 'jadwal, dosen, jp, hari', 'select dosen.nama_dosen, min(waktu_mulai) as mulai_mengajar from dosen, jp, jadwal, hari where dosen.nip=jadwal.nip and jadwal.id_jp_mulai=jp.id_jp and hari.id_hari=jadwal.id_hari and nama_hari=\'selasa\' group by dosen.nama_dosen', '');
